import request from "@/utils/request";
import * as echarts from "echarts";
import "echarts/map/js/china";
export default {
  name: "IndexView",
  data() {
    return {
      activeName: "",
      notices: [],
      disasterData: [],
      chartColors: ["#5470c6",
      // 蓝色
      "#91cc75",
      // 绿色
      "#fac858",
      // 黄色
      "#ee6666",
      // 红色
      "#73c0de",
      // 浅蓝
      "#3ba272",
      // 深绿
      "#fc8452",
      // 橙色
      "#9a60b4",
      // 紫色
      "#ea7ccc" // 粉色
      ]
    };
  },
  mounted() {
    this.fetchData();
  },
  methods: {
    // 获取后端数据
    fetchData() {
      request.get("/all").then(res => {
        if (res.code === "0") {
          this.disasterData = res.data;
          this.initCharts();
        } else {
          this.$message.error(res.msg);
        }
      });
    },
    // 初始化所有图表
    initCharts() {
      this.initPieChart();
      this.initMapChart();
      this.initRankingChart();
      this.initBarChart();
      this.initLineChart();
      this.initStackedBarChart();
      this.initRadarChart();
      this.initDataFormatChart();
    },
    // 饼图 - 灾情大类占比
    initPieChart() {
      const pieChart = echarts.init(document.getElementById("pieChart"));
      const categoryData = {};
      this.disasterData.forEach(item => {
        const category = item.disasterMajorCategory || "其他";
        categoryData[category] = (categoryData[category] || 0) + 1;
      });
      const chartData = Object.entries(categoryData).map(([name, value]) => ({
        name,
        value
      }));
      pieChart.setOption({
        title: {
          text: "不同灾情大类信息占比",
          left: "center",
          textStyle: {
            color: "#003366",
            fontSize: 16
          }
        },
        tooltip: {
          trigger: "item"
        },
        legend: {
          bottom: "3%",
          left: "center",
          textStyle: {
            color: "#003366",
            fontSize: 10
          }
        },
        series: [{
          name: "灾情类型",
          type: "pie",
          radius: ["30%", "50%"],
          label: {
            formatter: "{b}\n{d}%",
            color: "#003366",
            fontSize: 8
          },
          data: chartData,
          color: this.chartColors
        }]
      });
    },
    // 地图 - 各省灾情分布
    initMapChart() {
      const mapChart = echarts.init(document.getElementById("mapChart"));
      const provinceData = {};
      this.disasterData.forEach(item => {
        const province = item.province || "未知";
        provinceData[province] = (provinceData[province] || 0) + 1;
      });
      const chartData = Object.entries(provinceData).map(([name, value]) => ({
        name,
        value
      }));
      mapChart.setOption({
        title: {
          text: "各省灾情分布情况",
          left: "center",
          textStyle: {
            color: "#003366",
            fontSize: 16
          }
        },
        tooltip: {
          trigger: "item",
          formatter: "{b}<br/>灾情数量: {c}"
        },
        visualMap: {
          min: 0,
          max: Math.max(...chartData.map(d => d.value)),
          left: "left",
          textStyle: {
            color: "#003366"
          },
          inRange: {
            color: ["#d7f0fa", "#005bb5"]
          }
        },
        geo: {
          map: "china",
          label: {
            emphasis: {
              show: false
            }
          },
          itemStyle: {
            normal: {
              areaColor: "#f9f9f9",
              borderColor: "#ccc"
            },
            emphasis: {
              areaColor: "#d1ecff"
            }
          }
        },
        series: [{
          name: "灾情数量",
          type: "map",
          map: "china",
          data: chartData
        }]
      });
    },
    // 排名柱状图 - 按城市灾情数量
    initRankingChart() {
      const rankingChart = echarts.init(document.getElementById("rankingChart"));
      const cityData = {};
      this.disasterData.forEach(item => {
        const city = item.city || "未知";
        cityData[city] = (cityData[city] || 0) + 1;
      });
      const sortedData = Object.entries(cityData).sort((a, b) => b[1] - a[1]).slice(0, 10);
      rankingChart.setOption({
        title: {
          text: "按城市灾情数量排名",
          left: "center",
          textStyle: {
            color: "#003366",
            fontSize: 16
          }
        },
        tooltip: {
          trigger: "axis"
        },
        xAxis: {
          type: "value",
          axisLabel: {
            color: "#003366",
            fontSize: 10
          }
        },
        yAxis: {
          type: "category",
          data: sortedData.map(([name]) => name),
          axisLabel: {
            color: "#003366",
            fontSize: 10
          }
        },
        series: [{
          type: "bar",
          data: sortedData.map(([, value]) => value),
          itemStyle: {
            color: "#40a9ff"
          }
        }]
      });
    },
    // 柱状图 - 灾情类型分布
    initBarChart() {
      const barChart = echarts.init(document.getElementById("barChart"));
      const subCategoryData = {};
      this.disasterData.forEach(item => {
        const subCategory = item.disasterSubCategory || "其他";
        subCategoryData[subCategory] = (subCategoryData[subCategory] || 0) + 1;
      });
      const chartData = Object.entries(subCategoryData);
      barChart.setOption({
        title: {
          text: "灾情类型分布",
          left: "center",
          textStyle: {
            color: "#003366",
            fontSize: 16
          }
        },
        tooltip: {
          trigger: "axis"
        },
        xAxis: {
          type: "category",
          data: chartData.map(([name]) => name),
          axisLabel: {
            color: "#003366",
            fontSize: 8
          }
        },
        yAxis: {
          type: "value",
          axisLabel: {
            color: "#003366",
            fontSize: 8
          }
        },
        series: [{
          type: "bar",
          data: chartData.map(([, value]) => value),
          itemStyle: {
            color: "#91cc75"
          }
        }]
      });
    }
    // 折线图、堆叠柱状图、雷达图、矩形树图...
    // **保持风格统一，使用与之前一致的配色和样式**
  }
};
